svg.script:
function handleKdn(event) {return parent.window.handleKdn(event)};

function handleBoxMdn(event,jnum) {return parent.window.handleBoxMdn(document,event,jnum)};
function handleBoxMove(event,jnum) {return parent.window.handleBoxMove(document,event,jnum)};
function handleBoxMup(event,jnum) {return parent.window.handleBoxMup(document,jnum)};

function handleRowMov(event,jnum,jnumBox) {return parent.window.handleRowMov(event,jnum,jnumBox)};
function handleRowMou(jnum,jnumBox) {return parent.window.handleRowMou(jnum,jnumBox)};
function handleRowClick(event,jnum,jnumBox,num) {return parent.window.handleRowClick(event,jnum,jnumBox,num)};

document.onkeydown = handleKdn;
